  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'finalOne';

}
<ul>
  <li><button routerLink="/home" mat-button class="active">Home</button></li>
  <li><button routerLink="/news" mat-button>News</button></li>
  <li><button mat-button>About</button></li>
  <li class="right"><button mat-button>Contact</button></li>

  <li class="right"><button routerLink="/register" mat-button >Register</button></li>
  <li class="right"><button routerLink="/login" mat-button>Login</button></li>

</ul>
